import React from 'react';
import { useParams } from 'react-router-dom';
import { projects } from '../data/projectsData'; // Import your projects data here

function Project() {
    const { projectId } = useParams();
    const project = projects.find((p) => p.id === parseInt(projectId));

    if (!project) {
      return <div>Project not found</div>;
    }

    return (
      <div className="p-8">
        <h1 className="text-3xl font-semibold mb-6">{project.title}</h1>
        <p className="text-gray-600 mb-4">{project.description}</p>
        {/* Display other project details here */}
        <p>Project details and information go here.</p>
      </div>
    );
  }

export default Project;
